  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Pishkun
  National Wildlife Refuge outlines Refuge accomplishments from May through August
  of 1961. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, rodents, and raptors-
  is also covered. The Refuge development and maintenance section discusses physical
  developments. Resource management is outlined; topics include grazing. A progress
  report on field investigations and applied research is also provided. The public
  relations section of the report describes recreational uses. N-R forms are attached.\",\n\t\"owner_org\":
